package fonts

import (
	"encoding/base64"

	"github.com/golang/freetype/truetype"
)

const (
	// LatoRegular is the base64 encoded lato regular font
	LatoRegular = ""

	// LatoBlack is the base64 encoded lato black font
	LatoBlack = ""
)

// GetFont returns a truetype font based on provided base64encoded true type font file
func GetFont(base64ttf string) *truetype.Font {
	ttf, err := base64.StdEncoding.DecodeString(base64ttf)
	if err != nil {
		panic("base64 decode of font failed. " + err.Error())
	}

	font, err := truetype.Parse([]byte(ttf))
	if err != nil {
		panic("failed to parse font. " + err.Error())
	}
	return font
}
